import React, { useState,useEffect } from "react";
import Card from 'react-bootstrap/Card';
import Placeholder from 'react-bootstrap/Placeholder'
import Dropdown from 'react-bootstrap/Dropdown'

function Posts(){
    const [blog,setBlog]=useState([]);
    const [load,setLoad]=useState(false);
    const getBlogs=async()=>{
        try{
            setLoad(true);
            const res=await fetch("/blogs",{
                method:"GET",
                headers:{
                    "Content-Type":"application/json"
                }
            });
            if(res.status===200){
                const data=await res.json();
                setBlog(data);
                setLoad(false);
            }
        } catch (error) {
            console.error(error);
        }
    }
    useEffect(()=>{
        getBlogs();
      },[]);
    return(
        <div className="base">
        <div className="oneline">
        <h2 style="text-align:left;float:left;padding-right:25px">Employees</h2>
<div class="dropdown"style="text-align:left;float:left;margin-top:20px">
    <button class="btn btn-dark dropdown-toggle" type="button"
        data-toggle="dropdown">
        Config Menu <span class="caret"></span>
    </button>
    <ul class="dropdown-menu">
        <li><a href="#"  onclick="openAddNewEmployee()">Add New Employee ...</a></li>
    </ul>
</div>
        </div>
        <div style={{padding:"20px",justifyItems:"center",height:"75vh",overflowY:"scroll"}}>
        <div className="reverse">
            {(load===true)?(
                <div className="card w-75 m-auto">
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>
                <Placeholder /> <Placeholder style={{ width: '25%' }} />
                <Placeholder xs={6} />
                <br/>

            </div>
            ):(
                (blog.length>0)?(blog.reverse().map(p=>
                    <div>
                    <Card className="card w-75 m-auto">
                        <Card.Header as="h5">Topic: {p.type}</Card.Header>
                        <Card.Body>
                            <Card.Title>{p.title}</Card.Title>
                            <Card.Text>
                            {p.desc}
                            </Card.Text>
                            <p><b>By:</b> {p.writer}</p>
                        </Card.Body>
                    </Card>
                        <br/>
                    </div>
                )):(<></>))}
                </div>
        </div>
        </div>
    )
}
export default Posts;
